    var carouselInner = document.getElementById("carouselInner");
    var eventScroll = document.getElementById("eventScroll");

    function tampilEvent(){
      carouselInner.innerHTML = "";
      eventScroll.innerHTML = "";

      events.forEach(function(e, i){
        // Carousel
        var item = document.createElement("div");
        item.className = "carousel-item" + (i === 0 ? " active" : "");
        item.innerHTML = `
          <img src="${e.img}" class="d-block w-100" alt="${e.title}">
          <div class="carousel-caption">
            <h3>${e.title}</h3>
            <p>${e.date} • ${e.place}</p>
            <button class="btn btn-warning btn-sm" onclick="lihatDetail(${i})"><i class='fa fa-info-circle'></i> Detail</button>
          </div>`;
        carouselInner.appendChild(item);

        var card = document.createElement("div");
        card.className = "event-card";
        card.innerHTML = `
          <img src="${e.img}" alt="${e.title}">
          <div class="event-info">
            <strong>${e.title}</strong><br>
            <small>${e.date}</small>
          </div>`;
        card.onclick = function(){ lihatDetail(i); };
        eventScroll.appendChild(card);
      });
    }

    function lihatDetail(i){
      var e = events[i];
      document.getElementById("detailImg").src = e.img;
      document.getElementById("detailTitle").innerText = e.title;
      document.getElementById("detailDate").innerText = e.date;
      document.getElementById("detailTime").innerText = e.time;
      document.getElementById("detailPlace").innerText = e.place;
      document.getElementById("detailDesc").innerText = e.desc;
      var btn = document.getElementById("btnDaftar");
      btn.innerHTML = e.daftar ? '<i class="fa-solid fa-xmark"></i> Batal Daftar' : '<i class="fa-solid fa-ticket"></i> Daftar Event';
      btn.className = e.daftar ? "btn btn-secondary mt-2" : "btn btn-custom mt-2";
      btn.onclick = function(){
        e.daftar = !e.daftar;
        tampilEvent();
        var modal = bootstrap.Modal.getInstance(document.getElementById("detailModal"));
        modal.hide();
      }
      new bootstrap.Modal(document.getElementById("detailModal")).show();
    }

    tampilEvent();
